import Typewriter from "typewriter-effect";
const Home = () => {
  return (
    <div className="home">
      <img
        src="https://media.giphy.com/media/9GJ2wj29vRqrrx8LJ7/giphy.gif"
        alt=""
      />
      <Typewriter
        options={{
          strings: ["To kaise hai aap log"],
          autoStart: true,
          loop: true,
        }}
      />
    </div>
  );
};

export default Home;
